onChange.script:
if previousValue != currentValue:
	if self.custom.Split1SubReasons == -1:
		self.custom.Split1SubReason = -1

transforms.code:
reason = value
try:
	json = gpa.data.datasetToJson(self.params.statesDS)

	for j in json:
		if j.get('value') == reason:
			return j.get('ID')
except Exception as e:
	return -1

logger = system.util.getLogger('findingStateSubReasonCode')

try:
	json = gpa.data.datasetToJson(self.params.statesDS)
	if self.custom.Split1SubReasons == -1:
		return -1
	if value != -1:
		for j in json:
			if j.get('value') == value:
				return j.get('value')
	else: return -1

except Exception as e:
	logger.warn(str(e))

reason = self.getChild("root/Split1SubReason/Dropdown").props.value
if self.custom.Split1SubReasons == -1: 
	return -1
else:
	try:
		json = gpa.data.datasetToJson(self.custom.Split1SubReasons)

		for j in json:
			if j.get('value') == reason:
				return j.get('ID')
	except Exception as e:
		return -1

logger = system.util.getLogger('filterStateDS')
try:
    json = gpa.data.datasetToJson(value)
    parentID = self.custom.Split1Reason
    arr = []

    for j in json:
        if j.get('SubReasonOf') == parentID:
            arr.append(j)

    if len(arr) == 0:
        return -1
    else:
        return gpa.data.jsonToDataset(arr)

except Exception as e:
    logger.warn(str(e))

